<!DOCTYPE html>
<html lang="en">

<head>
	<meta charset="UTF-8">
	<meta http-equiv="X-UA-Compatible" content="IE=edge">
	<meta name="viewport" content="width=device-width, initial-scale=1.0">
	<title>Document</title>
	<script src="script.js"></script>
	<link rel="staylesheet" href="reset.css" />
	<link rel="staylesheet" href="style.css" />
</head>
<style>
	html {
		width: 100%;
		height: 100%;
	}

	body {
		font: normal 14px/1.618em "Roboto", sans-serif;
		height: 100%;
		background-color: rgb(221, 255, 218);
	}
    .img-con{
        width:10px;
    }	

	.flex {
		display: flex;
	}

	.flex-column-center {
		flex-direction: column;
		align-items: center;
	}

	.flex-row-center {
		flex-direction: column;
		justify-content: center;
	}
	.flex-row-start{
		justify-content: start;
	}


	.main-card {
		z-index: 3;
		width: auto;
		height: auto;
		min-width: 280px;
		min-height: 300px;

		border-radius: 10px;
		box-shadow: 0px 5px 7px 2px rgb(180, 176, 176);
		overflow: hidden;
		background-color: rgb(255, 255, 255);
		position: absolute;
		transform: translate(-50px -50px);
	}

	.profile-img {
		object-fit: cover;
		object-position: center;
		width: 150px;
		height: 150px;
margin-top: -60px;
	}

	div .profile-img {
		border-radius: 100%;
		box-shadow: 0px 0px 0px 5px white;
		z-index: 2;

	}

	.space {
		margin: 10px;
	}

	.banner {
		min-width: 280px;
		min-height: 150px;
	}
	.area{
    background: #4e54c8;  
    background: -webkit-linear-gradient(to left, #8f94fb, #4e54c8);  
    width: 100%;
    height:100vh;
    
   
}

.circles{
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    overflow: hidden;
}

.circles li{
    position: absolute;
    display: block;
    list-style: none;
    width: 20px;
    height: 20px;
    background: rgba(255, 255, 255, 0.2);
    animation: animate 25s linear infinite;
    bottom: -150px;
    
}

.circles li:nth-child(1){
    left: 25%;
    width: 80px;
    height: 80px;
    animation-delay: 0s;
}


.circles li:nth-child(2){
    left: 10%;
    width: 20px;
    height: 20px;
    animation-delay: 2s;
    animation-duration: 12s;
}

.circles li:nth-child(3){
    left: 70%;
    width: 20px;
    height: 20px;
    animation-delay: 4s;
}

.circles li:nth-child(4){
    left: 40%;
    width: 60px;
    height: 60px;
    animation-delay: 0s;
    animation-duration: 18s;
}

.circles li:nth-child(5){
    left: 65%;
    width: 20px;
    height: 20px;
    animation-delay: 0s;
}

.circles li:nth-child(6){
    left: 75%;
    width: 110px;
    height: 110px;
    animation-delay: 3s;
}

.circles li:nth-child(7){
    left: 35%;
    width: 150px;
    height: 150px;
    animation-delay: 7s;
}

.circles li:nth-child(8){
    left: 50%;
    width: 25px;
    height: 25px;
    animation-delay: 15s;
    animation-duration: 45s;
}

.circles li:nth-child(9){
    left: 20%;
    width: 15px;
    height: 15px;
    animation-delay: 2s;
    animation-duration: 35s;
}

.circles li:nth-child(10){
    left: 85%;
    width: 150px;
    height: 150px;
    animation-delay: 0s;
    animation-duration: 11s;
}



@keyframes animate {

    0%{
        transform: translateY(0) rotate(0deg);
        opacity: 1;
        border-radius: 0;
    }

    100%{
        transform: translateY(-1000px) rotate(720deg);
        opacity: 0;
        border-radius: 50%;
    }

}


</style>
